import React from 'react';
import { Outlet, Link, useLocation } from 'react-router-dom';
import { FiHome, FiUser, FiPlusSquare, FiList, FiMessageSquare, FiHeart, FiSettings } from 'react-icons/fi';

const Dashboard = () => {
  const location = useLocation();

  const menuItems = [
    { icon: FiHome, label: 'Overview', path: '/dashboard' },
    { icon: FiList, label: 'My Listings', path: '/dashboard/my-listings' },
    { icon: FiPlusSquare, label: 'Add Property', path: '/dashboard/create-property' },
    { icon: FiMessageSquare, label: 'Messages', path: '/dashboard/messages' },
    { icon: FiHeart, label: 'Favorites', path: '/dashboard/favorites' },
    { icon: FiUser, label: 'Profile', path: '/dashboard/profile' },
    { icon: FiSettings, label: 'Settings', path: '/dashboard/settings' },
  ];

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div className="hidden md:flex md:flex-shrink-0">
        <div className="flex flex-col w-64 bg-white border-r border-gray-200">
          <div className="flex items-center justify-center h-16 px-4 border-b border-gray-200">
            <h1 className="text-xl font-bold text-blue-600">Ethiopian Broker</h1>
          </div>
          <nav className="flex-1 px-2 py-4 space-y-1">
            {menuItems.map((item) => {
              const Icon = item.icon;
              const isActive = location.pathname === item.path;
              return (
                <Link
                  key={item.path}
                  to={item.path}
                  className={`flex items-center px-4 py-3 text-sm font-medium rounded-md ${
                    isActive
                      ? 'bg-blue-50 text-blue-600'
                      : 'text-gray-700 hover:bg-gray-100'
                  }`}
                >
                  <Icon className={`w-5 h-5 mr-3 ${isActive ? 'text-blue-500' : 'text-gray-400'}`} />
                  {item.label}
                </Link>
              );
            })}
          </nav>
        </div>
      </div>

      {/* Main content */}
      <div className="flex flex-col flex-1 overflow-hidden">
        {/* Mobile header */}
        <header className="md:hidden bg-white shadow-sm">
          <div className="flex items-center justify-between px-4 py-3">
            <h1 className="text-lg font-semibold text-gray-900">Dashboard</h1>
            <button className="text-gray-500 hover:text-gray-700">
              <svg className="w-6 h-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth={2}
                  d="M4 6h16M4 12h16M4 18h16"
                />
              </svg>
            </button>
          </div>
        </header>

        {/* Page content */}
        <main className="flex-1 overflow-y-auto p-4 md:p-6">
          <Outlet />
        </main>
      </div>
    </div>
  );
};

export default Dashboard;
